import React from 'react';
import ReactDOM from 'react-dom';

function ListComponent() {
    return (
        <ul style={{color: `red`}}>
            <li>Hello</li>
            <li>World</li>
            <li>?</li>
        </ul>
    )
}

ReactDOM.render(
    <ListComponent />

    , document.getElementById("root"));
